import fetch from 'isomorphic-fetch';

class Index extends React.Component {
  static async getInitialProps() {
    let stories = [];
    try {
      const res = await fetch('https://node-hnai.herokuapp.com/news?page=1');
      stories = await res.json();
    } catch (e) {
      console.log(e)
    }

    return { stories }
  }

  render() {
    return (
      <div>
        hacker news
      </div>
    )
  }
}

export default Index;
